swaptrade_modal_desc_crosschain_valuedif:
Följande avgifter beaktas i värdeskillnaden för bryggtransaktionen:
• Avgift för kedjeöverskridande brygga: {bridgePriceAndFee}
• Nätverksavgift på målnätverket: {toChainPriceAndFee}

När du handlar ett visst antal tokens påverkar det likviditetspoolens djup. Detta ändrar i sin tur den övergripande tillgängligheten och priset för tokens, vilket leder till märkbara prisskillnader.

swaptrade_swap_dialog_desc_bridge_risk:
{thirdParty} (”tredje part”) som aggregeras på OKX Wallet (”OKX”) är en centraliserad bro som styrs av sina egna användarvillkor. OKX är inte associerat med, och har inte heller någon kontroll över, verksamheten hos tredje part. OKX lämnar inga utfästelser avseende innehåll och tjänster från tredje part.

Du samtycker till och bekräftar att: (a) OKX inte är ansvarigt för förlust, skada eller andra konsekvenser som uppstår till följd av din användning av tredje part, inklusive {freezeContent};
(b) OKX kommer inte att svara på några klagomål eller tvister i samband med din användning av tredje part, och att du ska kontakta den tredje parten direkt för sådana klagomål och tvister på {thirdPartyContact}.

swaptrade_mid_dialog_desc_est_network_fe:
Vid bryggtransaktioner inkluderar denna avgift nätverksavgifterna för både källnätverket och den kedjeöverskridande bryggan.

Avgiften för denna transaktion består av:
· {chain} nätverksavgift: {value1}
· {bridge} nätverksavgift för brygga: {value2}

Vi tar inte ut några nätverksavgifter eftersom de är betalningar till miners.

swaptrade_intro_dialog_desc_cross_value_:
Värdeskillnaden för denna transaktion visas enligt följande:
· {chain} nätverksavgift: {value1}
· {bridge} bryggavgift: {value2}

Om värdeskillnaden är mycket större medan avgifterna som anges ovan är relativt små beror det på att bryggbeloppet har påverkat djupet i det här tokenparets likviditetspool.

swaptrade_intro_tooltip_trade_including_:
I bryggtransaktioner inkluderar kostnaden den beräknade nätverksavgiften för betalningsnätverket och en del av den kedjeöverskridande bryggans avgifter. Avgiftsuppdelning för transaktionen:
• Nätverksavgift: {fromChainPriceAndFee}
• Avgift för kedjeöverskridande brygga: {bridgePriceAndFee}
Nätverksavgiften täcker minerkostnader och debiteras inte av vår plattform.

swaptrade_dialog_subtitle_agree_acknowle:
Du samtycker till och bekräftar att:
(a) OKX inte är ansvarigt för förlust, skada eller andra konsekvenser som uppstår till följd av din användning av SWFT, inklusive {swftFreeze};
(b) OKX svarar inte på klagomål eller tvister relaterade till din användning av SWFT. Du kontaktar SWFT ({swftLink}) direkt för att låsa sådana klagomål och tvister.
